import React from 'react';
import './Initial_Web_Form.css';
import SignInSide from '../../login_page/login_page';
import UserName from './mainID';
//import TODO from './Todo/TodoApp'
import { BrowserRouter as Router,Route,Switch,Link } from "react-router-dom";
import BasketBall from './basketbsall'
import Singuppage from '../../sing_up/sing_up_page'
import MainPage from '../../MainPage'

export default function Initial_Web(){
    return(  
        <Router>
            <Switch>  
                <Route path = "MainPage"><MainPage/></Route >
                <Route path = "/signup" ><Singuppage/></Route>  
                <Route path = "/sign" ><SignInSide/></Route>
                <Route path = "/person_page"><UserName source="https://api.github.com/users/LinkRed1012"/></Route>
                <Route path = "/basketball_page" ><BasketBall/></Route>
            </Switch>            
        </Router>


    )
}
